const data = msg.payload;

const dailyData = data.reduce((acc, current) => {
    if (current.FID != undefined) {

        const id = current.FID;

        if (!acc[id]) {

            // Copy all properties from the current value and remove the timestamp
            acc[id] = { ...current };
            acc[id].count = 1;

            // Fetch the aggregation timestamp
            acc[id].timestamp = msg.aggregation_time.slice(0, 10);
        } else {
            // If this FID already exists, add to the values
            acc[id].consumption_kWh += current.consumption_kWh;
            acc[id].count += 1;
        }

        return acc;
    }
}, {});

// Calc the mean
const finalResult = Object.values(dailyData).map(item => {
    item.mean_consumption_kWh = item.consumption_kWh / item.count;
    return item;
});

msg.payload = Object.values(dailyData);

return msg;
